    with open(config_path, 'w', encoding='utf-8') as f:
        f.write(config.to_json(ensure_ascii=False, indent=2))


def update_last_open_emu_page(page: str):
    if page == 'ryujinx':
        config.setting.ui.lastOpenEmuPage = 'ryujinx'
    elif page == 'suyu':
        config.setting.ui.lastOpenEmuPage = 'suyu'
    else:
        config.setting.ui.lastOpenEmuPage = 'yuzu'
    logger.info(f'update lastOpenEmuPage to {config.setting.ui.lastOpenEmuPage}')
    dump_config()


def update_dark_state(dark: bool):
    if dark is None:
        dark = True
    config.setting.ui.dark = dark
    logger.info(f'update dark to {config.setting.ui.dark}')
    dump_config()


def update_setting(setting: Dict[str, object]):
    logger.info(f'updating settings: {setting}')
    config.setting = CommonSetting.from_dict(setting)
    dump_config()


__all__ = ['config', 'dump_config', 'YuzuConfig', 'current_version', 'RyujinxConfig', 'update_dark_state',
           'update_last_open_emu_page', 'update_setting', 'user_agent', 'shared']

import argparse
import logging
import gevent.monkey

gevent.monkey.patch_ssl()
gevent.monkey.patch_socket()

import sys
from config import config, dump_config
from utils.webview2 import can_use_webview

logger = logging.getLogger(__name__)


def start_ui(mode=None):
    import ui
    ui.main(mode=mode)
    return 0


def start_webview_ui():
    import ui_webview
    ui_webview.main()
    return 0


def try_start_webview():
    try:
        return start_webview_ui()
    except Exception as e:
        logger.error('Error occur in start_webview_ui', e)
        return fallback_to_browser()


def fallback_to_browser():
    config.setting.ui.mode = 'browser'
    dump_config()
    return start_ui(None)


def create_parser():
    parser = argparse.ArgumentParser()
    parser.add_argument(
        "-m",
        "--mode",
        choices=['webview', 'browser', 'chrome', 'edge', 'user default'],
        help="指定 ui 启动方式",
    )
    parser.add_argument(
        "--switch-mode",
        choices=['auto', 'webview', 'browser', 'chrome', 'edge', 'user default'],
        help="切换 ui 启动方式",
    )
    parser.add_argument(
        "--no-sentry",
        action='store_true',
        help="禁用 sentry",
    )
    return parser


def main():
    parser = create_parser()
    args = parser.parse_args()
    logger.info(f'args: {args}')

    if args.switch_mode is not None:
        logger.info(f'switch mode: {args.switch_mode}')
        config.setting.ui.mode = args.switch_mode
        dump_config()
        return 0

    from module.external.bat_scripts import create_scripts
    create_scripts()

    if not args.no_sentry:
        from module.sentry import init_sentry
        init_sentry()

    ui_mode = args.mode or config.setting.ui.mode
    logger.info(f'ui mode: {ui_mode}')
    if ui_mode is None or ui_mode == 'auto':
        ui_mode = 'webview' if can_use_webview() else 'browser'
    if ui_mode == 'browser':
        return start_ui(None)
    elif ui_mode == 'webview':
        return try_start_webview()
    else:
        return start_ui(ui_mode)


if __name__ == '__main__':
    sys.exit(main())

